import React from "react";
import getRandom1to6 from "../../utils/utils";

function Cube({ numberOfCubes }) {
  const rollDice = () => {
    const cubes = [];
    for (let i = 0; i < numberOfCubes; i++) {
      const dice = getRandom1to6();
      console.log(dice);
      cubes.push(dice);
    }
  };
  return (
    <div>
      hello
      {cubes.map((number) => {
        <span>{number}</span>;
      })}
    </div>
  );
}

export default Cube;
